import React from'react'
import Navbar from "./components/Navbar"
import {browserRouter as Router, Switch, Route} from "react-router-dom"

function App() {
  return (
    <div className="App">
        <Router>
        <Navbar />
          <Switch>
            <Route path='/' exact />
          </Switch>
        </Router>

    </div>
  );
}

export default App;
